Event.create( member_id: 1,  title: ' Confèrence sur La bibliotherapie  ', description: '  "
Conférence:

La Bibliothérapie:
Vous aimez les livres et vous savez que le lien que nous entretenons avec eux est particulier ?
Vous allez adorer la bibliothérapie.Dans un cadre unique, la Shanti Home , j animerai une conférence sur la bibliothérapie,
Au programme ?
Définition, origines et évolutions, ainsi que les applications possibles de cette discipline.Puis j évoquerai la bibliothérapie intuitive telle que je la conçois et la pratique au quotidien. Enfin je répondrai avec plaisir à vos questions.

L après-midi

Séances individuelles bibliothérapie intuitive (60 €)

Lionel Aobdia a la capacité de « recevoir », par intuition, une liste de lectures capables de vous révéler à vous-même, de trouver votre place dans l’incarnation ou même de changer votre vie ! On a tous un jour rencontré « par hasard », un livre qui a chamboulé notre vie. Alors, provoquez ce fameux hasard, et repartez avec les titres de VOS livres lumières et inspirants qui vont résonner avec qui vous êtes, ici et maintenant !" ', price_max:   20  , begin: DateTime.new(  2016,10,22,10,00,00 ), end: DateTime.new( 2016,10,22,12,00,00 ), adress: '  La Shanti Home  14 rue des nangues  ', zip: ' 94350 ', town: '  Villiers sur marne  ')
