Event.create( member_id: 1,  title: ' Friday Night Fever… ', description: '  La Friday Night Fever (La Fièvre du Vendredi Soir) est un cours régulier ouvert de Movement Medicine © sans inscription préalable, sans niveau et à partir de 12 ans accompagné. Cette danse, est une pratique vivante de Méditation en Mouvement qui nous invite, sans aucune restriction, à laisser notre « physicalité », nos émotions et notre créativité s’activer ensemble. Et ce pour, entre autres, permettre à nos corps, cœur et esprit d’être pleinement alignés et en relation. Se laisser danser par et avec les cycles de la vie. Danser librement avec tout ce qui est en nous, nous constitue et nous compose. Danser dans le respect de chacun-e et de nos environnements. Une belle façon de finir la semaine et glisser dans son week-end. Pas besoin d'être danseu-r/-se pour venir. Il n’y pas de niveaux. Par contre, le désir d’explorer en mouvement les différents paysages de l’humanité est bienvenu.  ', price_max:   20  , begin: DateTime.new(  2017,09,01,20,00,00 ), end: DateTime.new( 2017,09,01,22,00,00 ), adress: '  Gymnase de l'église américaine  Eglise américaine 64 Quai d'Orsay   ', zip: ' 75007 ', town: '  Paris ')
