Event.create( member_id: 1,  title: ' Atelier Danse en Nature ', description: '  "Venez participer à une journée d explorations dansées en Nature d'après le travail d'Anna Halprin à seulement 35 minutes de Paris depuis la Gare du Nord.

Ce stage sera l'occasion de partir à la découverte de soi grâce à une immersion en nature pour se découvrir au-delà de nos habitudes quotidiennes.
La nature est en mouvement. Nous le sommes aussi. Nous retournons dans la nature pour nous connecter avec les besoins de notre corps, et laisser le lieu nous informer sur pourquoi nous sommes venus.

La nature est un tout et nous participons à ce grand tout.
Expirer, inspirer, fermer les yeux, écouter, prendre contact, toucher, ouvrir les yeux et se laisser voir,... Répondre en mouvement à l instant et à nos sens en éveil. Être présent dans le corps et dans l’instant: le point de départ de cette approche" ', price_max:   50  , begin: DateTime.new(  2017,10,01,11,00,00 ), end: DateTime.new( 2017,10,01,17,30,00 ), adress: '  Forêt de Montmorency    ', zip: ' 75012 ', town: '  Montmorency ')
Event.create( member_id: 1,  title: ' Atelier Life Art Process  ', description: '  "Thème: Lourdeur/Légèreté
Un atelier pour se révéler à soi-même au-delà de ses habitudes quotidiennes dans un contexte créatif ! Danse, dessin, écriture: comment la danse et différents supports artistiques nous amènent à être plus en contact avec nous-mêmes et à l'explorer en tant qu'humain et en tant qu'artiste !

Ouvert à tous - il n'est pas nécessaire d'être danseur, dessinateur ou écrivain pour participer pleinement à ses ateliers !"  ', price_max:   50  , begin: DateTime.new(  2017,11,05,11,00,00 ), end: DateTime.new( 2017,11,05,17,00,00 ), adress: '  Théâtre de la Danse 77 rue de Charonne  ', zip: ' 75011 ', town: '  Paris ')
Event.create( member_id: 1,  title: ' Cours hedbo Travail Somatique & Improvisation Dansée  ', description: '  "Au cours de ces ateliers hebdomadaires, nous prendrons un temps pour affiner la perception que nous avons de notre corps à travers son langage premier: le mouvement.
Ralentir pour mieux sentir, se ressourcer, se mettre en lien avec soi-même !

Nous travaillerons avec des séquences de mouvement simples pour prendre conscience de notre schéma corporel, explorer la richesse des mouvements des différentes structures de notre corps et les liens qui les animent.
Ressourcée par cette pratique, notre créativité pourra s’exprimer au travers d’explorations et d’improvisations dansées, seul ou en groupe pour faire l'expérience de nouvelles manières de nous mettre en mouvement."  ', price_max:   15  , begin: DateTime.new(  2017,09,27,20,30,00 ), end: DateTime.new( 2017,09,27,22,30,00 ), adress: '  MELC  Rue de l'Eider  ', zip: ' 95800 ', town: '  Courdimanche  ')
Event.create( member_id: 1,  title: ' Chakradance ', description: '  "Atelier découverte de Chakradance
Venez explorer votre monde intérieur par votre propre danse libre et intuitive, portée par des musiques qui entrent en résonance avec chacun des chakras et guidée par des images et des visualisations spécifiques.

Danser les 7 chakras est une expérience joyeuse et revigorante qui permet de contacter des aspects profonds de votre être et de découvrir, affirmer et célébrer qui vous êtes vraiment.
C’est aussi une méditation dansée qui vient de l’intérieur et qui favorise la guérison et l'harmonisation. Cette pratique permet d'évacuer stress et tensions, de se recentrer et se ressourcer, et d'équilibrer peu à peu tout votre système émotionnel et énergétique." ', price_max:   17  , begin: DateTime.new(  2017,10,01,14,00,00 ), end: DateTime.new( 2017,10,01,15,30,00 ), adress: '  Yogi Yoga Bar 2 rue Lacharrière ', zip: ' 75011 ', town: '  Paris ')
