Event.create( member_id: 1,  title: ' Samedi je danse!: Equilibre & déséquilibre  ', description: '  "Une approche sensible, poétique et émotionnelle du corps en mouvement

Un temps pour approfondir la pratique des 5 Rythmes, élargir le vocabulaire de notre danse et développer sensibilité et intelligence corporelles. Le travail s'appuiera aussi sur des outils issus de diverses pratiques somatiques, de la danse contact et de l improvisation. Des feed-back personnalisés seront proposés à ceux qui le souhaiteront pour affiner la cohérence corporelle et élargir l’expression dans le mouvement. Un espace où rencontrer notre authenticité, où explorer de nouveaux chemins. Où expérimenter la danse comme une métaphore de la vie nous permettant de reconnaître et de transformer nos schémas. "  ', price_max:   50  , begin: DateTime.new(  2017,06,14,14,30,00 ), end: DateTime.new( 2017,06,14,18,30,00 ), adress: '  Studio One Step   18-20 rue du Faubourg du Temple   ', zip: ' 75011 ', town: '  Paris ')
Event.create( member_id: 1,  title: ' Samedi je danse!: Equilibre & déséquilibre  ', description: '  "Une approche sensible, poétique et émotionnelle du corps en mouvement

Un temps pour approfondir la pratique des 5 Rythmes, élargir le vocabulaire de notre danse et développer sensibilité et intelligence corporelles. Le travail s'appuiera aussi sur des outils issus de diverses pratiques somatiques, de la danse contact et de l improvisation. Des feed-back personnalisés seront proposés à ceux qui le souhaiteront pour affiner la cohérence corporelle et élargir l’expression dans le mouvement. Un espace où rencontrer notre authenticité, où explorer de nouveaux chemins. Où expérimenter la danse comme une métaphore de la vie nous permettant de reconnaître et de transformer nos schémas. "  ', price_max:   50  , begin: DateTime.new(  2017,06,14,14,30,00 ), end: DateTime.new( 2017,06,14,18,30,00 ), adress: '  Studio One Step   18-20 rue du Faubourg du Temple   ', zip: ' 75011 ', town: '  Paris ')
Event.create( member_id: 1,  title: ' Danse des 5 Rythmes. Samedi je danse!: Territoires  ', description: '  Comment je prends un espace, comment j’habite, traverse, protège, accueille? Qu’est-ce qui fait que je me sens chez moi, ailleurs, en sécurité, dans l’inconfort, perdu? Comment prendre le risque de sortir de mes zones de confort, de découvrir d’autres horizons ? Apprendre à affirmer et à assouplir mes limites. Déployer une danse où je me sens bien et qui conjugue audace et confiance, signature personnelle et fraîcheur du renouvellement.  ', price_max:   50  , begin: DateTime.new(  2017,12,16,14,30,00 ), end: DateTime.new( 2017,12,16,18,30,00 ), adress: '  Studio One Step   18-20 rue du Faubourg du Temple   ', zip: ' 75011 ', town: '  Paris ')
Event.create( member_id: 1,  title: ' Samedi je danse!: Transitions ', description: '  "Nous explorerons l’espace entre les Rythmes, le mystère et les potentialités de cet entre-deux. Est-ce que je le vis comme un vide ou un plein? Comment j’aborde ces transitions: incertitude, continuité, rupture, opportunité, malaise, résistance, confiance? Nous nous accorderons le temps de goûter ces moments pour faire l’expérience de la transition créative et sereine.
" ', price_max:   50  , begin: DateTime.new(  2017,02,17,14,30,00 ), end: DateTime.new( 2017,02,17,18,30,00 ), adress: '  Studio One Step   18-20 rue du Faubourg du Temple   ', zip: ' 75011 ', town: '  Paris ')
Event.create( member_id: 1,  title: ' Samedi je danse!: Harmonie et conflit ', description: '  Notre aspiration naturelle à l’harmonie nous incite à esquiver, dénigrer, voire nier le conflit. Les impromptus, les dissonances, les discordances sont pourtant de belles ressources musicales. Ces froissements déjouent la monotonie et nous réveillent. Ils sont d’ailleurs inévitables. A nous de les convertir en ressources pour enrichir notre connaissance de nous-mêmes et la vitalité de notre danse.    ', price_max:   50  , begin: DateTime.new(  2017,04,07,14,30,00 ), end: DateTime.new( 2017,04,07,18,30,00 ), adress: '  Studio One Step   18-20 rue du Faubourg du Temple   ', zip: ' 75011 ', town: '  Paris ')
