Event.create( member_id: 1,  title: ' Danser la vague des 5 Rythmes ', description: '  "Les 5 rythmes sont traversés à partir de propositions, chaque fois différentes, qui focalisent l’attention  sur le corps et l’énergie qui l’anime. Dans un esprit à la fois ludique et attentif au sensible, chaque danseur trouve l’expression personnelle de sa danse. Le groupe est une source d’inspiration et de partage propice à lâcher les jugements pour qu’intention commune et liberté de chacun créent un espace d’improvisation d’une créativité toujours nouvelle.

