Event.create( member_id: 1,  title: ' Danses Circulaires Sacrées: Célébrer l'Hiver et la Terre  ', description: '  "Le 21 décembre, c’est le solstice d’hiver de l’hémisphère nord, la terre entre en repos, certains animaux hibernent, et pour nous c’est l’occasion d’entrer en introspection, de se retrouver avec soi-même, de laisser partir ce qui ne sert plus.
Dans la mythologie grecque, Demeter est la déesse de l’agriculture et de la fertilité de la Terre. C’est elle qui a créé les saisons, dont l’hiver, en voulant sauver sa fille Perséphone alors prisonnière du royaume d’Hadès.

Pour nous, ce sera donc la double occasion de danser la Terre, de sentir le sol sous nos pieds, et aussi de danser la lenteur et le silence de l’hiver.
" ', price_max:   15  , begin: DateTime.new(  2017,12,22,20,00,00 ), end: DateTime.new( 2017,12,22,22,00,00 ), adress: '  MicaDanses - Studio So Schnell (2ème sous-sol)  15 rue Geoffroy L asnier  ', zip: ' 75004 ', town: '  Paris ')
Event.create( member_id: 1,  title: ' Danses Circulaires Sacrées  ', description: '  "Dans toutes les tribus et à toutes les époques, la danse sacrée faisait partie des rituels de la communauté. Le cercle, symbole universel, ayant souvent pour centre le feu ou des objets sacrés (talismans, fleurs, etc.) représentait l’espace où la communauté célébrait les rituels de passage (naissance, mariage, décès) et les autres moments importants de la vie humaine.

Les Danses Circulaires Sacrées ®, aussi connues sous le nom de « Danses en Rond » ou « Danses du Peuple », furent initialement collectées et/ou créées par le chorégraphe et danseur allemand/polonais Bernhard Wosien et synthétisent les danses de différentes cultures dans un répertoire très diversifié: danses traditionnelles, régionales, folkloriques et contemporaines d’Israël, d’origine Celte, de Turquie, des Balkans, de Russie, d’Amérique Latine, etc.

Elles s’inscrivent donc dans la continuité de pratiques ancestrales, antiques et profondes.

Le terme “sacré”, est utilisé en lien avec les objectifs de ces danses: faire émerger la joie de vivre, le respect et la douceur pour soi, pour l’autre et pour la vie, l’amélioration de l’estime de soi, entres autres.
La ronde formée par les mains jointes fait circuler une énergie positive dans le groupe. "  ', price_max:   15  , begin: DateTime.new(  2017,12,05,20,15,00 ), end: DateTime.new( 2017,12,05,22,30,00 ), adress: '  Budokan 4 rue Fénelon ', zip: ' 76600 ', town: '  Le Havre  ')
Event.create( member_id: 1,  title: ' "Dé-pensez" vous dans la danse  ', description: '  "Dé-penser, ce n’est pas seulement l’occasion de se « vider la tête », mais de prendre conscience des croyances limitantes ou invalidantes qui se sont installées insidieusement en nous. Par exemple (je dois être parfait pour plaire et être aimé, je dois faire plaisir aux autres et ne pas leur dire non, je dois refréner mes émotions pour montrer que je suis fort, etc…). Il y en a beaucoup comme ça, c’est ce que l’on appelle aussi les messages contraignants ou « drivers » en anglais. Ils se sont installés inconsciemment tout au long de notre vie, certains remontant à notre enfance, issus de notre éducation, de nos parents, professeurs, camarades de classe…
La proposition de cet atelier sera d’identifier certains de ces messages ou pensées négatives, de les jouer en dansant, puis de s’en séparer ou les « brûler » corporellement avec la gestuelle appropriée.
Sur une musique plus douce et des mouvements plus fluides, la dernière phase consistera à les remplacer par des pensées soutenantes et positives comme « je mérite d’être heureux, je n’ai pas besoin du regard des autres pour exister, j’ai le droit de ne pas me laisser envahir par les autres, je peux montrer ma vulnérabilité,… »

L’échauffement démarrera à 18h30, merci de ne pas dépasser 19h pour ne pas troubler le démarrage. L’atelier se terminera vers 20h30.

L’Espace Danse Libre est ouvert à tous. Les femmes sont souvent majoritaires, aussi j’invite particulièrement les hommes à laisser leur contrôle de côté et venir goûter les bienfaits du lâcher-prise dans le non-jugement. Les enfants (à partir de 12 ans de préférence) sont également les bienvenus."  ', price_max:   15  , begin: DateTime.new(  2017,12,02,18,30,00 ), end: DateTime.new( 2017,12,02,20,30,00 ), adress: '  Salle A (sous-sol)  11 rue des Champs Roger   ', zip: ' 78400 ', town: '  Chatou  ')
